import React, { useEffect, useState } from "react";

const TenantList = () => {
  const [tenants, setTenants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState("");

  const photoFields = [
    "PassportCopyPath",
    "EIDCopyPath",
    "ResidenceVisaCopyPath",
    "BankStatementCopyPath",
    "DepositChequeCopyPath",
    "SecurityChequeCopyPath",
    "EjariMunicipalRegistrationCopyPath",
  ];

  const columns = [
    "TenancyContractNumber",
    "PropertyCode",
    "TenantName",
    "TenantDOB",
    "TenantNationality",
    "TenantPassportNumber",
    "TenantEmiratesID",
    "TenantPassportExpiryDate",
    "TenantEIDExpiryDate",
    "TenantEmployer",
    "TenantMobileNumber",
    "TenantEmailID",
    "LeaseStartDate",
    "LeaseEndDate",
    "MoveInDate",
    "MoveOutDate",
    "RentAmount",
    "DepositAmountReceived",
    "NumberOfPayments",
    "RentAmountReceived",
    "RentAmountOutstanding",
    ...photoFields,
    "CreatedBy",
    "CreationDate",
  ];

  useEffect(() => {
    fetchTenants();
  }, []);

  const fetchTenants = async () => {
    try {
      setLoading(true);
      const res = await fetch("http://localhost:5000/tenant_list_api", {
        method: "GET",
        credentials: "include",
      });
      const data = await res.json();

      // Convert LONGBLOB to Base64 for document previews
      data.forEach((t) => {
        photoFields.forEach((field) => {
          if (t[field]) t[field] = btoa(
            String.fromCharCode(...new Uint8Array(t[field].data || t[field]))
          );
        });
      });

      setTenants(data);
    } catch (err) {
      console.error("Error fetching tenants:", err);
      alert("Error fetching tenants");
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (contractNumber) => {
    if (!window.confirm(`Are you sure you want to delete tenant ${contractNumber}?`)) return;
    try {
      const res = await fetch(`http://localhost:5000/tenant_delete_api/${contractNumber}`, {
        method: "DELETE",
        credentials: "include",
      });
      const data = await res.json();
      if (res.ok) {
        alert(`✅ ${data.message}`);
        setTenants(tenants.filter((t) => t.TenancyContractNumber !== contractNumber));
      } else {
        alert(`❌ ${data.message || "Failed to delete tenant"}`);
      }
    } catch (err) {
      console.error(err);
      alert("❌ Error deleting tenant");
    }
  };

  const filteredTenants = tenants.filter((t) =>
    ["TenancyContractNumber", "TenantName"].some((key) =>
      String(t[key] ?? "").toLowerCase().includes(searchTerm.toLowerCase())
    )
  );

  const labelize = (s) => s.replace(/([A-Z])/g, " $1").replace(/_/g, " ").replace(/\b\w/g, (ch) => ch.toUpperCase()).trim();

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: 20, background: "#f5f6fa" }}>
      <h2 style={{ textAlign: "center", background: "#2f3640", color: "white", padding: 15, margin: 0, borderRadius: "8px 8px 0 0" }}>
        Tenant List
      </h2>

      <div style={{ display: "flex", justifyContent: "space-between", margin: "15px 0" }}>
        <div>
          <span>{new Date().toLocaleDateString()}</span> | <span>Total Tenants: {filteredTenants.length}</span>
        </div>
        <div>
          <a href="/index" style={{ textDecoration: "none", fontWeight: "bold", color: "#333" }}>← Go Back Home</a>
        </div>
      </div>

      <input
        type="text"
        placeholder="Search by Contract No or Tenant Name..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
        style={{ marginBottom: 10, padding: 6, width: "50%", borderRadius: 5, border: "1px solid #aaa" }}
      />

      <div style={{ overflowX: "auto", background: "white", padding: 20, borderRadius: 10, boxShadow: "0 0 15px rgba(0,0,0,0.2)" }}>
        {loading ? (
          <p>Loading tenants...</p>
        ) : (
          <table style={{ width: "100%", borderCollapse: "collapse" }}>
            <thead>
              <tr>
                {columns.map((col) => (
                  <th
                    key={col}
                    style={{ padding: 8, border: "1px solid #ccc", background: "#273c75", color: "white", cursor: "pointer" }}
                  >
                    {labelize(col)}
                  </th>
                ))}
                <th style={{ padding: 8, border: "1px solid #ccc", background: "#273c75", color: "white" }}>Actions</th>
              </tr>
            </thead>
            <tbody>
              {filteredTenants.map((t, idx) => (
                <tr key={idx} style={{ backgroundColor: idx % 2 === 0 ? "#f2f2f2" : "#fff" }}>
                  {columns.map((col) => (
                    <td key={col} style={{ padding: 8, border: "1px solid #ccc", textAlign: "center" }}>
                      {photoFields.includes(col) && t[col] ? (
                        <img src={`data:image/jpeg;base64,${t[col]}`} alt={col} style={{ width: 60, height: 60, borderRadius: 6, border: "1px solid #ccc" }} />
                      ) : t[col] ?? ""}
                    </td>
                  ))}
                  <td style={{ padding: 8, border: "1px solid #ccc", textAlign: "center" }}>
                    <a href={`/edit_tenant/${t.TenancyContractNumber}`} style={{ marginRight: 10, color: "#0097e6", fontWeight: "bold", textDecoration: "none" }}>Edit</a>
                    <button
                      onClick={() => handleDelete(t.TenancyContractNumber)}
                      style={{ backgroundColor: "#c0392b", color: "white", border: "none", padding: "5px 10px", borderRadius: 4, cursor: "pointer" }}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default TenantList;
